        assistant\ncontent: Hello! I''m a bot that can connect you to people. Tell
        me a little about what you''re looking for and I''ll try to find someone relevant
        to you.\n\n\ndate: 2024-11-29 19:41:55\nrole: user\ncontent: Native Spanish
